import { Component, OnInit } from '@angular/core';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';
import { Router } from '@angular/router';
import { ApiService } from 'src/app/services/api.service';
import { AuthService } from 'src/app/services/auth.service';
import { ToastController, LoadingController } from '@ionic/angular';

@Component({
  selector: 'app-login',
  templateUrl: './login.page.html',
  styleUrls: ['./login.page.scss'],
  standalone: false
})
export class LoginPage implements OnInit {
  loginForm: FormGroup;
  errorMessage: string = '';

  constructor(
    private fb: FormBuilder,
    private apiService: ApiService,
    private authService: AuthService,
    private router: Router,
    private toastController: ToastController,
    private loadingController: LoadingController
  ) {
    this.loginForm = this.fb.group({
      uporabnikoIme: ['', Validators.required],
      geslo: ['', Validators.required]
    });
  }

  ngOnInit() {
  }

  async onLogin() {
    if (this.loginForm.valid) {
      const loading = await this.loadingController.create({
        message: 'Prijavljanje...',
      });
      await loading.present();

      const { uporabnikoIme, geslo } = this.loginForm.value;
      this.apiService.prijava(uporabnikoIme, geslo).subscribe({
        next: async (res) => {
          await loading.dismiss();
          this.authService.login(res);
          this.router.navigate(['/home']);
        },
        error: async (err) => {
          await loading.dismiss();
          console.error('Login error:', err);

          if (err.error && typeof err.error === 'object' && err.error.message) {
            this.errorMessage = err.error.message;
          } else if (typeof err.error === 'string') {
            this.errorMessage = err.error;
          } else {
            this.errorMessage = err.message || 'Prijava ni uspela. Preverite podatke.';
          }

          const toast = await this.toastController.create({
            message: this.errorMessage,
            duration: 3000,
            color: 'danger',
            position: 'bottom'
          });
          toast.present();
        }
      });
    } else {
      this.loginForm.markAllAsTouched();
    }
  }

  goToRegister() {
    this.router.navigate(['/register']);
  }
}
<ion-content [fullscreen]="true">
  <div class="min-h-screen flex items-center justify-center bg-gradient-to-br from-blue-50 to-blue-100 p-4">
    
    <!-- Card -->
    <div class="max-w-md w-full bg-white rounded-2xl shadow-2xl p-8">
      
      <!-- Icon -->
      <div class="mb-8">
        <div class="inline-flex items-center justify-center p-3 bg-blue-600 rounded-xl">
          <ion-icon name="bicycle" class="text-white text-3xl"></ion-icon>
        </div>
      </div>

      <!-- Title & Subtitle -->
      <h1 class="text-3xl font-bold text-gray-900 mb-2">Dobrodošli</h1>
      <p class="text-gray-600 mb-8">Prijavite se v svoj račun</p>

      <!-- Form -->
      <form [formGroup]="loginForm" (ngSubmit)="onLogin()" class="space-y-5">
        
        <!-- Username -->
        <div>
          <label class="block text-sm font-medium text-gray-700 mb-1">Uporabniško ime</label>
          <input 
            type="text" 
            formControlName="uporabnikoIme"
            class="w-full px-4 py-3 border border-gray-300 rounded-lg focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-transparent transition-all"
            [class.border-red-500]="loginForm.get('uporabnikoIme')?.invalid && loginForm.get('uporabnikoIme')?.touched"
          >
          <div *ngIf="loginForm.get('uporabnikoIme')?.invalid && loginForm.get('uporabnikoIme')?.touched" class="text-red-500 text-xs mt-1">
            Uporabniško ime je obvezno.
          </div>
        </div>

        <!-- Password -->
        <div>
          <label class="block text-sm font-medium text-gray-700 mb-1">Geslo</label>
          <input 
            type="password" 
            formControlName="geslo"
            class="w-full px-4 py-3 border border-gray-300 rounded-lg focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-transparent transition-all"
            [class.border-red-500]="loginForm.get('geslo')?.invalid && loginForm.get('geslo')?.touched"
          >
          <div *ngIf="loginForm.get('geslo')?.invalid && loginForm.get('geslo')?.touched" class="text-red-500 text-xs mt-1">
            Geslo je obvezno.
          </div>
        </div>

        <!-- Error Message -->
        <div *ngIf="errorMessage" class="p-3 bg-red-50 border border-red-200 rounded-lg text-red-700 text-sm">
          {{ errorMessage }}
        </div>

        <!-- Submit Button -->
        <button 
          type="submit" 
          [disabled]="loginForm.invalid"
          class="w-full py-3 px-4 bg-blue-600 hover:bg-blue-700 text-white font-medium rounded-lg shadow-sm transition-colors focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-blue-500 disabled:opacity-50 disabled:cursor-not-allowed"
        >
          Prijava
        </button>

        <!-- Register Link -->
        <div class="text-center mt-6">
          <p class="text-sm text-gray-600">
            Nimate računa? 
            <a (click)="goToRegister()" class="text-blue-600 hover:text-blue-800 font-medium cursor-pointer">Registrirajte se</a>
          </p>
        </div>

      </form>
    </div>
  </div>
</ion-content>
